import React from 'react';
import Matricula from './app/enrollment/matricula.jsx';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ChatEstudiante from './app/user/ChatEstudiante.jsx';
import ChatProfesor from './app/user/ChatProfesor.jsx';

/*
function App() {
  return (
    <div className="App">
      <Matricula />
    </div>
  );
}
*/

import { Navigate } from 'react-router-dom';

<Router>
  <Routes>
    <Route path="/" element={<Navigate to="/chat/estudiante" />} />
    <Route path="/chat/estudiante" element={<ChatEstudiante />} />
    <Route path="/chat/profesor" element={<ChatProfesor />} />
  </Routes>
</Router>

export default App;
